DROP PROCEDURE IF EXISTS `getProCommFeature`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getProCommFeature`()
BEGIN
  SELECT pi.property_code AS PCODE,pi.property_category as category,pi.property_type as PType,cp.pro_sub_type as subtype,
  pi.property_name as PName,pi.property_image as image,pi.property_details as Details,td.vendor_total_price as Price,
  pa.street_address as street,pa.Location_name as Location,pa.city_name as city,pa.state_name as state,pa.zip_code as zip,
  fr.bathroom as bathroom,fr.parking as parking,fr.swimming_pool as swim_pool,fr.aircondition,
  fr.nearest_highway_distance as highwayDist,fr.nearest_bank_distance as railwayDist,
  fr.nearest_hospital_distance as hospitalDist
  from
  tblproperty_information pi,
  tblproperty_trading td,
  tblproperty_address pa,
  tblcommercial_property cp,
  tblfeature_commercial fr
   where (pi.property_code=td.property_code)
    and (pi.property_code=pa.property_code)
  and (cp.property_code=pi.property_code)
  and (cp.commercial_Property_code=fr.commercial_property_code);
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

