DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proAddUpdateAddress`(
                                      in op varchar(10),
                                      in prop_address_code int(5),
                                      in prop_code int(5),
                                      in street varchar(50),
                                      in location varchar(20),
                                      in city varchar(20),
                                      in state varchar(20),
                                      in zip bigint(11)

                                      )
BEGIN
declare i int(5);
select max(property_address_code) into i from tblProperty_Address;
if i is null then
  set i=101;
else
  set i=i+1;
end if;
if(op='INSERT') then
  insert into tblProperty_Address values(i,prop_code,street,location,city,state,zip);
  commit;
else
  if(op='UPDATE') then
  update tblProperty_Address set street_address=street,location_name=location,city_name=city,state_name=state,zip_code=zip where property_address_code=prop_address_code;
  commit;
end if;
end if;
END $$
