DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proAddUpdateInformation_property`(
  in  op varchar(10),
  in  prop_code int(5),
  in  prop_category varchar(20),
  in  prop_price_type varchar(10),
  in  prop_area_feet bigint(3),
  in  prop_type varchar(40),
  in  prop_name varchar(20),
  in  prop_image longblob,
  in  prop_details varchar(500),
  in  prop_floor int(2),
  in  isfreehold varchar(5),
  in  status varchar(20),
  in  userid bigint(20),
  in  resi_prop_code int(5),
  in  bedroom bigint(2),
  in  bathroom bigint(2),
  in  hall bigint(2),
  in  kitchen bigint(2),
  in  max_floor bigint(3),
  in  prosubtype varchar(30),
  out m varchar(200)
)
BEGIN
 declare i int(5);
 declare j int(5);
 declare k int(5);
 select max(property_code) into i from tblproperty_information;
 select max(commercial_property_code) into j from tblcommercial_property;
 select max(residential_property_code) into k from tblResidential_property;
 if i is null then
   set i=1001;
 else
   set i=i+1;
 end if;
 if j is null then
   set j=1001;
 else
   set j=j+1;
 end if;
 if k is null then
   set k=1001;
 else
   set k=k+1;
 end if;
 if(op='INSERT') then
     insert into tblproperty_information values(i,prop_category,prop_price_type,prop_area_feet,prop_type,prop_name,prop_image,prop_details,prop_floor,isfreehold,sysdate(),status,userid);
     if(prop_type='Residential')then
       insert into tblResidential_property values(k,i,bedroom,bathroom,hall,kitchen,max_floor,prosubtype);
     else
       insert into tblcommercial_property values(j,i,prosubtype);
     end if;
    commit;
	  set m='Property Information Succesfully Inserted';
 else if(op='UPDATE')then
    update tblproperty_information set property_category=prop_category,property_price_type=prop_price_type,property_area_feet=prop_area_feet,property_type=prop_type,property_name=prop_name,property_image=prop_image,property_details=prop_details,isfreehold=isfreehold,property_status=status where property_code=prop_code;
    if(prop_type='Residential')then
      update tblResidential_property set bedroom=bedroom,bathroom=bathroom,hall=hall,kitchen=kitchen,max_floor=max_floor,PRO_SUB_TYPE=prosubtype where residential_property_code=resi_prop_code;
    end if;
    end if;
    commit;
    set m='Property Information Succesfully Updated';
 end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

