--
-- Definition of procedure `proSearch_Property`
--

DROP PROCEDURE IF EXISTS `proSearch_Property`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proSearch_Property`( in start_price int,
  in end_price int,
  in state_name1 varchar(50),
  in city_name1 varchar(50),
  in badroom1 int,
  in start_property_area_feet1 int,
  in end_property_area_feet1 int,
  in property_type1 varchar(50),
  in pricetype varchar(50),
  in property_category1 varchar(50),
  out status1 varchar(50))
begin
     if property_type1 = 'Residential' then
      if property_category1 = 'Rent' then
        select a.property_code as code,a.property_name as name,a.property_details as detail,a.property_area_feet as area,b.vender_total_price as price , c.city_name as city,c.state_name as state from tblproperty_information a,tblproperty_rental b , tblproperty_address c where a.property_code In
        (select property_code from tblproperty_rental where vender_total_price Between start_price and end_price and STATUS='Available' and property_code IN
        (select property_code from tblproperty_address where state_name=state_name1 and city_name=city_name1 and property_code IN
        (select property_code from tblResidential_property where bedroom=badroom1  and property_code IN
        (select property_code from tblproperty_information where property_area_feet Between start_property_area_feet1  and end_property_area_feet1 and property_type=property_type1 and property_category=property_category1 )
        )
        )
        )
        and b.property_code = a.property_code and c.property_code = a.property_code;
        set status1 = 'true';
      else if property_category1 = 'Buy' then
        select a.property_code as code,a.property_name as name,a.property_details as detail,a.property_area_feet as area,b.vendor_total_price as price , c.city_name as city,c.state_name as state from tblproperty_information a,tblproperty_trading b , tblproperty_address c where a.property_code In
        (select property_code from tblproperty_trading where vendor_total_price Between start_price and end_price and STATUS='Available' and property_code IN
        (select property_code from tblproperty_address where state_name=state_name1 and city_name=city_name1 and property_code IN
        (select property_code from tblResidential_property where bedroom=badroom1 and property_code IN
        (select property_code from tblproperty_information where property_area_feet Between start_property_area_feet1 and end_property_area_feet1 and property_type=property_type1 and property_category=property_category1 )
        )
        )
        )
       and b.property_code = a.property_code and c.property_code=a.property_code;
        set status1 = 'true';

      else if property_category1 = 'Sale'then
        select a.property_code as code,a.property_name as name,a.property_details as detail,a.property_area_feet as area,b.vendor_total_price as price , c.city_name as city,c.state_name as state from tblproperty_information a,tblproperty_trading b , tblproperty_address c where a.property_code In
        (select property_code from tblproperty_trading where vendor_total_price Between start_price and end_price and STATUS='Available'and property_code IN
        (select property_code from tblproperty_address where state_name=state_name1 and city_name=city_name1 and property_code IN
        (select property_code from tblResidential_property where bedroom=badroom1 and property_code IN
        (select property_code from tblproperty_information where property_area_feet Between start_property_area_feet1 and end_property_area_feet1 and property_type=property_type1 and property_category=property_category1 )
        )
