-- Definition of procedure `pro_add_client_per_det`
--

DROP PROCEDURE IF EXISTS `pro_add_client_per_det`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_add_client_per_det`(

  IN OP VARCHAR(10),
  IN PASS VARCHAR(20),
  IN UID BIGINT(20),
  IN USTATUS VARCHAR(4),
  IN CNAME VARCHAR(50),
  IN CTYPE VARCHAR(15),
  IN EMAIL VARCHAR(50),
  IN SQ1 VARCHAR(200),
  IN SA1 VARCHAR(200),
  IN DOB DATE,
  IN ADDR VARCHAR(100),
  IN STATE VARCHAR(20),
  IN CNTRY VARCHAR(20),
  IN PIN BIGINT(6),
  IN CITY VARCHAR(20),
  IN STDCD VARCHAR(10),
  IN LNDLINE VARCHAR(11),
  IN MBL VARCHAR(15),
  OUT M VARCHAR(200)
)
BEGIN
 DECLARE I BIGINT(20);
 DECLARE S BIGINT(20);
 DECLARE ID BIGINT(20);

declare continue handler for 1452
set m='sorry user id already exist,please try another userid';
declare continue handler for 1062
set m='sorry email and pass already exist,please try another emailid passd ';
  SET M = 'YOU HAVE REGISTERED SUCCESSFULLY';
  SELECT MAX(USER_ID) INTO I FROM TBLCLIENT_PERSONAL_DETAILS;
  IF I IS NULL THEN
    SET I = 1001;
  ELSE SET I = I+1;
  END IF;

   SELECT MAX(SERIAL_NO) INTO S FROM TBLCLIENT_ADDRESS_DETAILS;
  IF S IS NULL THEN
    SET S = 101;
  ELSE SET S = S+1;
  END IF;

  IF(OP='INSERT') THEN
    INSERT INTO TBLCLIENT_PERSONAL_DETAILS VALUES(I, CNAME, CTYPE, EMAIL, DOB, SYSDATE());
     INSERT INTO TBLLOGIN VALUES(I,PASS,EMAIL,(rand()*10000),USTATUS, CTYPE,SQ1,SA1);
   INSERT INTO TBLCLIENT_ADDRESS_DETAILS VALUES(S, I, ADDR, CITY,STATE, CNTRY,PIN);
   INSERT INTO TBLCLIENT_PHONE_DETAILS VALUES(S, I, STDCD, LNDLINE, MBL);
    COMMIT;
   
  ELSE


    UPDATE TBLCLIENT_PERSONAL_DETAILS SET
      CLIENT_NAME = CNAME,
      CLIENT_TYPE = CTYPE,
      EMAIL_ID = EMAIL,
      DATE_OF_BIRTH = DOB
    WHERE USER_ID = UID;


    COMMIT;
    
  END IF;



END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

