  in u bigint(20),
  in name varchar(50),
  in dob1 date,
  in clt varchar(15),
  in addr varchar(100),
  in st varchar(20),
  in ct varchar(20),
  in pin bigint,
  in cntry varchar(20),
  in stdc varchar(10),
  in lndline varchar(20),
  in mob varchar(15),
  out m varchar(100)

)
BEGIN
   UPDATE TBLCLIENT_PERSONAL_DETAILS SET
    CLIENT_NAME=name,
    CLIENT_TYPE=clt,
    DOB=dob1
    WHERE USER_ID = u;

 UPDATE TBLLOGIN SET
      CLIENT_TYPE=clt
     WHERE USER_ID = u;

 UPDATE TBLCLIENT_PHONE_DETAILS SET
    STD_CODE=stdc,
    LANDLINE_NO=lndline,
   MOBILE_NO=mob
        WHERE USER_ID = u;
 UPDATE TBLCLIENT_ADDRESS_DETAILS SET
    ADDRESS=addr,
    CITY=ct,
    STATE= st,
    COUNTRY=cntry,
    PIN=pin
    WHERE USER_ID = u;
set m=' Your profile update  successfully';

END $$
